<div className="card-body">{country}</div> */
}

export default class CountryProfile extends Component {
  constructor(props) {
    super(props);

    this.state = { topics: [] };
  }

  componentDidMount() {
    axios
      .get("http://localhost:5000/events/topics")
      .then((response) => {
        this.setState({ topics: response.data });
        console.log(this.state);
      })
      .catch((error) => console.log(error));
  }

  exerciseList() {
    return this.state.topics.map((currentevent) => {
      return <Topic topic={currentevent} key={currentevent._id} />;
    });
  }

  render() {
    return (
      <div className="card shadow mb-4">
        <table className="table">
          <thead className="thead-light">
            <tr>
              <th>Topics</th>
              <th>Places Mentioned</th>
              <th>Interactions Per Minute</th>
            </tr>
          </thead>
          <tbody>{this.exerciseList()}</tbody>
        </table>
      </div>
    );
  }
}
